CREATE TABLE look_book (
    id uuid not null,
    created_at timestamp(6),
    deleted_at timestamp(6),
    updated_at timestamp(6),
    image varchar(255),
    title varchar(255),
    user_id uuid not null,
    primary key (id)
);

CREATE TABLE look_book_post (
    id uuid not null,
    created_at timestamp(6),
    deleted_at timestamp(6),
    updated_at timestamp(6),
    look_book_id uuid,
    post_id uuid,
    primary key (id)
);

CREATE TABLE post (
    id uuid not null,
    created_at timestamp(6),
    deleted_at timestamp(6),
    updated_at timestamp(6),
    image varchar(500) not null,
    name varchar(255) not null,
    rainfall_type integer not null,
    review varchar(255) not null,
    sky_status integer not null,
    temperature float(53) not null,
    user_id uuid not null,
    wind_chill DOUBLE PRECISION DEFAULT 11.5,
    primary key (id)
);

CREATE TABLE post_image (
    id uuid not null,
    created_at timestamp(6),
    deleted_at timestamp(6),
    updated_at timestamp(6),
    url varchar(255),
    post_id uuid,
    primary key (id)
);

CREATE TABLE users (
    id bigserial not null,
    address varchar(100),
    email varchar(50) not null,
    password varchar(100) not null,
    profile_url varchar(100),
    role varchar(20) default USER not null,
    username varchar(50) not null,
    primary key (id)
);

CREATE TABLE region (
    id bigserial not null,
    created_at timestamp(6),
    updated_at timestamp(6),
    parent_region_id int null,
    full_name varchar(255) not null,
    name varchar(255) not null,
    depth integer not null,
    lat decimal(10, 6) not null,
    lng decimal(10, 6) not null,
    ordering integer not null default 0,
    primary key (id)
);

ALTER TABLE if EXISTS users
    ADD CONSTRAINT UK_6dotkott2kjsp8vw4d0m25fb7 UNIQUE (email);

ALTER TABLE if EXISTS look_book_post
    ADD CONSTRAINT FK9ojqjh47mkvew898irmvn8jti
    FOREIGN KEY (look_book_id)
    REFERENCES look_book;

ALTER TABLE IF EXISTS look_book_post
    ADD CONSTRAINT FKq05jedx5gia1akeexewscmtl5
    FOREIGN KEY (post_id)
    REFERENCES post;

ALTER TABLE IF EXISTS post_image
    ADD CONSTRAINT FKsip7qv57jw2fw50g97t16nrjr
    FOREIGN KEY (post_id)
    REFERENCES post;

ALTER TABLE IF EXISTS region
    ADD CONSTRAINT FKsip7qv57jwa1akeexewscmtl5
    FOREIGN KEY (parent_region_id)
    REFERENCES region;

ALTER TABLE IF EXISTS region
    ADD CONSTRAINT UQ_sip7qv57jwa1akeexewscmtl5
    UNIQUE (full_name);

CREATE INDEX idx_sip7qv57jwa1akeexewscmtl5 ON region (ordering);


